export class CreateUpdateReqRemoveResourceComponent extends ParentOptMgtComponent {
    constructor(datepipe, translate, fb, authService, utilService, apiService, dialogRef) {
        super(authService);
        this.datepipe = datepipe;
        this.translate = translate;
        this.fb = fb;
        this.authService = authService;
        this.utilService = utilService;
        this.apiService = apiService;
        this.dialogRef = dialogRef;
        this.readonly = "";
        this.siteCodeList = [];
        this.customerCode = '';
        this.empNumber = '';
        this.isDataLoading = false;
        this.custCodeControl = new FormControl('', Validators.required);
        this.empNumberControl = new FormControl('', Validators.required);
        this.isArabic = false;
        this.isFromProjectsAction = false;
        this.projectsList = [];
        this.filteredCustCodes = this.custCodeControl.valueChanges.pipe(startWith(this.customerCode), debounceTime(utilService.autoDelay()), distinctUntilChanged(), switchMap((val) => {
            if (val.trim() !== '')
                this.isDataLoading = true;
            return this.filterCustCodes(val || '');
        }));
    }
    filterCustCodes(val) {
        return this.apiService.getall(`CustomerMaster/getSelectCustomerList?search=${val}`)
            .pipe(map(response => {
            const res = response;
            this.isDataLoading = false;
            return res;
        }));
    }
    filterEmpNumbers(val) {
        return this.apiService.getall(`EmployeesToProjectSite/getAutoFillEmployeeListForProjectSite/${this.form.controls['projectCode'].value}/${this.form.controls['siteCode'].value}/?search=${val}`)
            .pipe(map(response => {
            const res = response;
            this.isDataLoading = false;
            return res;
        }));
    }
    ngOnInit() {
        this.isDataLoading = true;
        this.setForm();
        this.isArabic = this.utilService.isArabic();
        if (this.id > 0) {
            this.readonly = "readonly";
            this.editForm();
            // this.loadSiteCodes(this.form.controls['siteCode'].value);
        }
        else {
            this.readonly = "";
            this.isDataLoading = false;
        }
    }
    setForm() {
        this.form = this.fb.group({
            'customerCode': ['', Validators.required],
            'projectCode': ['', Validators.required],
            'siteCode': ['', Validators.required],
            'id': [this.id],
            'fromDate': ['', Validators.required],
            'employeeNumber': ['', Validators.required],
        });
        if (this.isFromProjectsAction) {
            this.custCodeControl.setValue(this.projectData.customerCode);
            this.form.controls['siteCode'].setValue(this.projectData.siteCode);
            this.form.controls['projectCode'].setValue(this.projectData.projectCode);
            this.form.controls['customerCode'].setValue(this.projectData.customerCode);
            this.loadProjectsList(this.projectData.customerCode);
            this.loadSiteCodes(this.projectData.projectCode);
            this.onSelectionSiteCode();
        }
    }
    onSelectionCustomerCode(event, op) {
        let custCode = '';
        if (op == 1) {
            custCode = event.option.value;
        }
        else if (op == 2) {
            custCode = event.target.value;
        }
        else if (op == 3) {
            custCode = event;
        }
        this.apiService.getall('CustomerMaster/getCustomerByCustomerCode/' + custCode).subscribe(res => {
